import React, { Component } from 'react';
import './components/stylesheet.css';
import WebcamComponent from './components/webcamComponent'
import DisplayText from './components/displayText'

class App extends Component {
    render() {
        const test = false;

        if (test) {
            return (
                <div >
                    <DisplayText />
                    <WebcamComponent />
                </div >
            );
        }
    }
}

export default App;
